A calculator needs a lot of buttons, and we'll use the grid layout with make_widget: let buttons = make_widget! { #[layout(grid)] #[handler(msg = Key)] #[widget(config=noauto)] struct { #[widget(col = 0, row = 0)] _ = TextButton::new_msg("&clear", Key::Clear).with_keys(&[VK::Delete]), #[widget(col = 1, row = 0)] _ = TextButton::new_msg("&÷", Key::Divide).with_keys(&[VK::Slash]), #[widget(col = 2, row = 0)] _ = TextButton::new_msg("&×", Key::Multiply).with_keys(&[VK::Asterisk]), #[widget(col = 3, row = 0)] _ = TextButton::new_msg("&−", Key::Subtract), #[widget(col = 0, row = 1)] _ = TextButton::new_msg("&7", Key::Char('7')), #[widget(col = 1, row = 1)] _ = TextButton::new_msg("&8", Key::Char('8')), #[widget(col = 2, row = 1)] _ = TextButton::new_msg("&9", Key::Char('9')), #[widget(col = 3, row = 1, rspan = 2)] _ = TextButton::new_msg("&+", Key::Add), #[widget(col = 0, row = 2)] _ = TextButton::new_msg("&4", Key::Char('4')), #[widget(col = 1, row = 2)] _ = TextButton::new_msg("&5", Key::Char('5')), #[widget(col = 2, row = 2)] _ = TextButton::new_msg("&6", Key::Char('6')), #[widget(col = 0, row = 3)] _ = TextButton::new_msg("&1", Key::Char('1')), #[widget(col = 1, row = 3)] _ = TextButton::new_msg("&2", Key::Char('2')), #[widget(col = 2, row = 3)] _ = TextButton::new_msg("&3", Key::Char('3')), #[widget(col = 3, row = 3, rspan = 2)] _ = TextButton::new_msg("&=", Key::Equals).with_keys(&[VK::Return, VK::NumpadEnter]), #[widget(col = 0, row = 4, cspan = 2)] _ = TextButton::new_msg("&0", Key::Char('0')), #[widget(col = 2, row = 4)] _ = TextButton::new_msg("&.", Key::Char('.')), } impl kas::WidgetConfig { fn configure(&mut self, mgr: &mut Manager) { // Enable key bindings without Alt held: mgr.enable_alt_bypass(true); } }
}; Here, you see, we didn't need to use #[derive(Debug, Widget)] since the make_widget macro does it for us. We also didn't need to mention the core or layout-data fields. We didn't bother naming those buttons or even explicitly typing them (naming and typing are optional). Also notice that the struct type is unnamed, and similarly the following impl block doesn't name type. Grid layout This is pretty simple to use: #[layout(grid)], and specify col and row in the #[widget] attribute. The number of rows and columns is auto-detected. Both row and col are optional, with the default value 0. In a few cases we see spans: e.g. cspan = 2 implies that two columns are spanned, starting from the column selected by col. Both rspan and cspan default to 1 if not specified. Key bindings Like several other GUI toolkits, KAS allows shortcut keys to be specified through the label, e.g. &clear binds the C key. (Usually this method of binding is only seen in menus, but in KAS it can be used on most "activatable" controls.) TextButton allows additional keys can be specified through TextButton::with_keys . Both the above types of bindings are usually only accessible while the Alt key is held — the difference being that those specified through a label also underline the letter/symbol following the &. In a calculator, it is desirable that these keys are accessible without Alt held. Manager::enable_alt_bypass enables this (for the whole window). We could potentially call this method elsewhere, e.g. in an event handler, but we do so in the WidgetConfig::configure method. (Notice how we used #[widget(config=noauto)] to opt out of deriving WidgetConfig ). The Key message One last thing to notice from the above snippet is that each button returns some variant of the Key enum as its message when pressed. We should go ahead and define this: #[derive(Clone, Debug, VoidMsg)]
enum Key { Clear, Divide, Multiply, Subtract, Add, Equals, Char(char),
} The only thing of note here is that Key uses derive(VoidMsg): this is a macro which implements From<VoidMsg> for the type. All message types should do this.

