Widget is "just" a trait, but it is better to think of it as a family of traits, since all widgets must implement WidgetCore , WidgetChildren , Layout , WidgetConfig , event::Handler , event::SendEvent and finally Widget . It is not recommended, or even supported, to implement all these traits explicitly. Instead, the derive(Widget) macro must be used, as in this example: use kas::event::VoidMsg;
use kas::macros::Widget;
use kas::widget::{Label, TextButton}; #[derive(Debug, Widget)]
#[layout(column)]
struct Counter { #[widget_core] core: kas::CoreData, #[layout_data] layout_data: <Self as kas::LayoutData>::Data, #[widget(halign = centre)] display: Label<String>, #[widget] button: TextButton<VoidMsg>, counter: u32,
} impl Counter { fn new() -> Counter { Counter { core: Default::default(), layout_data: Default::default(), display: Label::new("0".to_string()), button: TextButton::new("&count"), counter: 0, } }
}
